b) Test management processes
1) Defining processes that cover the management of testing for a whole project or any test level (e.g. system testing) or test type (e.g. performance testing) within a project (e.g. project test management, system test management, performance test management).
2) The test management processes are:
i) test strategy and planning process;
ii) test monitoring and control process;
iii) test completion process.
